import React from "react";

function ImageAndText(props) {
  for (const d in props.data) {
    if (Array.isArray(props.data[d])) {
      props.data[d] = props.data[d].join(" ");
    }
  }
  console.log(props.data);
  return (
  <main>
    <section className={props.data.section == null ? 'section' : props.data.section}>
    <div className={props.data.info == null ? 'info' : props.data.info}>
    <h1 className={props.data.headingClass == null ? "heading" : props.data.headingClass}>{props.data.heading}</h1>
      <p className={ props.data.sectionClass == null ? "p-intro" : props.data.sectionClass}>{props.data.p}</p>
      </div>
    </section>
  </main>

  );
}

export default ImageAndText;


